function essb_draw_readymade_list() {
	global $ready_made_names;
	
	$ready_made_names = array();
	$ready_made_names['group1'] = 'Popular Styles';
	$ready_made_names['mashable'] = "Mashable Style";
	$ready_made_names['upworthy'] = "Upworthy Style";
	$ready_made_names['essb'] = "Default demo of Easy Social Share Buttons";
	$ready_made_names['copyblogger'] = "CopyBlogger Style";
	$ready_made_names['addthis1'] = "AddThis Style Sidebar 1";
	$ready_made_names['addthis2'] = "AddThis Style Sidebar 2";
	$ready_made_names['addthis3'] = "Sidebar Style 3";
	$ready_made_names['group3'] = 'Width layout concepts';
	$ready_made_names['fullwidth1'] = 'Full width share buttons';
	$ready_made_names['fullwidth2'] = 'Full width share buttons with leading button';
	$ready_made_names['columns'] = 'Display in columns';
	$ready_made_names['demo1'] = "Fixed width buttons with names";
	$ready_made_names['demo4'] = "Fixed width buttons without names";
	$ready_made_names['group2'] = 'Button style contepts';
	$ready_made_names['button1'] = "Regular button with icon and name";
	$ready_made_names['button2'] = "Button without icon";
	$ready_made_names['button3'] = 'Button with icon only';
	$ready_made_names['button4'] = 'Button with icon and name appear on hover';
	$ready_made_names['button5'] = 'Button without icon at full width';
	$ready_made_names['button6'] = 'Button with icon only at full width';
	
	$output = '';
	$goback = esc_url_raw(add_query_arg(array('import' => 'true'), 'admin.php?page=essb_redirect_import&tab=import'));
	$output .= '<ul class="essb-ready-made">';
	
	foreach ($ready_made_names as $key => $text) {
		$class = (strpos($key, 'group') === false) ? 'style' : 'group';
		if ($class != 'group') {
			$output .= '<li class="essb-rm-type-'.$class.'"><a href="'.$goback.'&ready_style='.$key.'">'.$text.'</a>';
		}	
		else {
			$output .= '<li class="essb-rm-type-'.$class.'"><a href="#">'.$text.'</a>';
		}
	}
	
	$output .= '</ul>';
	
	print $output;
}